        id:'u1',
        name:'Sumeet Jumde',
        image:'https://www.google.com/url?sa=i&url=https%3A%2F%2Ftwitter.com%2FJumdeSumeet&psig=AOvVaw1s6RpWuMVAPWGSiXgVeVkj&ust=1700576052459000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCLDigM7h0oIDFQAAAAAdAAAAABAE',
        places:1
    }];
    return(
        <>
        Working
        <UserList items={Users}/>
        </>
    );
}

export default Users;
